:root {
  --red: #f9032f;
  --black: #000;
  --white: #fff;
}
h1 {
  color: var(--red);
  font-family: inherit;
  text-transform: uppercase;
}
* {
  box-sizing: border-box;
  margin: 0;
  padding: 0;
  font-family: "Poppins", sans-serif;
}

.navbar {
  background: var(--black);
  height: 60px;
  padding: 0.5rem calc((100vw - 1200px) / 2);
  display: flex;
  align-items: center;
  justify-content: space-between;
}

.navbar__logo {
  color: var(--white);
  text-decoration: none;
  padding: 0rem 1rem;
}
.navbar__link {
  color: var(--white);
  text-decoration: none;
  margin-left: 1.2rem;
}

.navbar__link:hover {
  color: var(--red);
  transition: 0.3s all ease-in-out;
}
@media screen and (max-width: 768px) {
  body.active {
    overflow-y: hidden;
    overflow-x: hidden;
  }
  .navbar__logo {
    color: var(--white);
    text-decoration: none;
    padding: 0rem 1rem;
  }
  .navbar__link {
    display: flex;
    align-items: center;
    justify-content: center;
  }

  .navbar__menu {
    display: grid;
    grid-template-columns: 1fr;
    grid-template-rows: repeat(4, 100px);
    position: absolute;
    width: 100%;
    top: -1000px;
  }

  .navbar__menu.active {
    top: 7%;
    opacity: 1;
    z-index: 99;
    height: 100vh;
    font-size: 1.5rem;
    background: var(--black);
    transition: 0.5s all ease-in-out;
  }

  .navbar__toggle .bar {
    width: 25px;
    height: 3px;
    margin: 5px auto;
    transition: all 0.3s ease-in-out;
    background: var(--red);
    display: block;
    cursor: pointer;
  }

  #mobile-menu {
    position: absolute;
    top: 10%;
    z-index: 1000;
    right: 5%;
    transform: translate(5%, 20%);
  }
  #mobile-menu.is-active .bar:nth-child(2) {
    opacity: 0;
  }
  #mobile-menu.is-active .bar:nth-child(3) {
    transform: translateY(-8px) rotate(-45deg);
  }
  #mobile-menu.is-active .bar:nth-child(1) {
    transform: translateY(8px) rotate(45deg);
  }
}

/* HERO SECTION */
.hero {
  background: linear-gradient(to right, rgba(0, 0, 0, 0.4), rgba(0, 0, 0, 0.9)),
    url("images/gym3.jpg");
  height: 100vh;
  background-position: center;
  background-size: cover;
  padding: 0.5rem calc((100vw - 1200px) / 2);
  display: flex;
  justify-content: center;
  align-items: center;
}
.hero_services {
  background: linear-gradient(to right, rgba(0, 0, 0, 0.4), rgba(0, 0, 0, 0.9)),
    url("images/trainer1.webp");
  height: 100vh;
  background-position: center;
  background-size: cover;
  padding: 0.5rem calc((100vw - 1200px) / 2);
  display: flex;
  justify-content: center;
  align-items: center;
}

.hero__content {
  color: var(--white);
  padding: 3rem 1rem;
  line-height: 1;
}

.hero__content h1 {
  font-size: clamp(3rem, 8vw, 7rem);
}

.hero__content p {
  font-size: clamp(1rem, 4vw, 2.5rem);
  margin-bottom: 3rem;
}

.button {
  padding: 1rem 2rem;
  background: var(--red);
  color: #fff;
  text-transform: uppercase;
  letter-spacing: 2px;
  border-radius: 5px;
  transition: 0.5s ease;
  font-size: 1rem;
  text-decoration: none;
}

.button:hover {
  background: var(--black);
  color: #fff;
  border: 2px solid var(--red);
}

/* Servicess Section */
.services {
  padding: 8rem calc((100vw - 1200px) / 2);
}
.services__container {
  display: grid;
  grid-template-columns: 1fr 1fr;
  padding: 1rem;
}
.services__img {
  width: 100%;
  height: 100%;
}

.topline {
  color: var(--red);
  text-transform: uppercase;
  font-weight: 700;
  font-size: 2rem;
  letter-spacing: 2px;
  margin-bottom: 0.5rem;
}

.services__heading {
  margin-bottom: 1rem;
  font-size: clamp(2rem, 6vw, 3rem);
}

.services__features {
  list-style: none;
}

.services__feature {
  margin-bottom: 1.5rem;
  font-size: clamp(1rem, 5vw, 1.2rem);
}

.fa-check-circle {
  margin-right: 0.5rem;
  color: var(--red);
}
@media screen and (max-width: 768px) {
  .services__container {
    grid-template-columns: 1fr;
  }
}

/* Membership Section */
.memberships {
  background: var(--black);
  color: var(--white);
  padding: 6rem calc((100vw - 1100px) / 2);
  text-align: center;
}
.membership h1 {
  color: var(--red);
  margin-bottom: 1rem;
  font-size: clamp(2rem, 5vw, 3rem);
  padding: 0 1rem;
}

.membership__desc {
  margin-bottom: 3rem;
  font-size: clamp(1rem, 3vw, 1.5rem);
  padding: 1rem;
}
.membership__wrapper {
  display: flex;
  justify-content: space-between;
  align-items: flex-start;
  padding: 1rem;
}

.membership__card {
  padding: 1.5rem;
  min-height: 450px;
  width: 325px;
  background: var(--white);
  color: var(--black);
  border-radius: 10px;
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  text-align: center;
}

.membership__perks {
  min-height: 150px;
}

.membership__card p {
  margin-bottom: 1rem;
}
.card-icon {
  font-size: 3rem;
  margin-bottom: 2rem;
  color: var(--red);
}

.membership__card h3 {
  font-size: clamp(1rem, 5vw, 2rem);
  margin-bottom: 1rem;
}

@media screen and (max-width: 1100px) {
  .membership__wrapper {
    flex-direction: column;
    align-items: center;
  }
  .membership__card {
    width: 90%;
    margin-bottom: 2rem;
  }
}

/* TEAM SECTION */
.team {
  padding: 8rem calc((100vw - 1100px) / 2);
}
.team__wrapper {
  display: grid;
  grid-template-columns: 1fr 1fr;
  grid-template-rows: repeat(auto, 350px);
}
.team__card {
  margin: 1rem;
  border-radius: 10px;
  position: relative;
}
.team__text {
  padding: 1rem;
  text-align: center;
}
.team__text h1 {
  margin-bottom: 1rem;
  font-size: 3rem;
}

.team__desc {
  font-size: clamp(1rem, 3vw, 1.3rem);
  line-height: 1.4;
}

.team__card p {
  position: absolute;
  bottom: 30px;
  color: var(--white);
  left: 25px;
  font-size: 3rem;
}

.team__img {
  width: 100%;
  height: 100%;
  border-radius: 10px;
}

.text__text:nth-child(1) {
  grid-row: 1/3;
  grid-column: 2 / 3;
}

.team__card:nth-child(2) {
  grid-row: 5/6;
  grid-column: 1/2;
}
.team__card:nth-child(3) {
  grid-row: 1 /3;
  grid-column: 1 /2;
}
.team__card:nth-child(4) {
  grid-row: 2 /4;
  grid-column: 2 /3;
}
.team__card:nth-child(5) {
  grid-row: 3 /5;
  grid-column: 1 /2;
}
.team__card:nth-child(6) {
  grid-row: 4 /6;
  grid-column: 2 /3;
}

@media screen and (max-width: 768px) {
  .team__wrapper {
    grid-template-columns: 1fr;
    grid-template-rows: auto;
  }
  .text__text:nth-child(1) {
    grid-row: 1/2;
    grid-column: 1 / 2;
  }

  .team__card:nth-child(2) {
    grid-row: 6/7;
    grid-column: 1/2;
  }
  .team__card:nth-child(3) {
    grid-row: 3 /4;
    grid-column: 1 /2;
  }
  .team__card:nth-child(4) {
    grid-row: 4 /5;
    grid-column: 1 /2;
  }
  .team__card:nth-child(5) {
    grid-row: 5 /6;
    grid-column: 1 /2;
  }
  .team__card:nth-child(6) {
    grid-row: 2/3;
    grid-column: 1 /2;
  }
}

.spinner img {
  position: fixed;
  left: 0px;
  top: 0px;
  width: 100%;
  height: 100%;
  z-index: 9999;
  background: url("images/giphy.gif") 50% 50% no-repeat rgb(249, 249, 249);
  opacity: 0.8;
  animation: spin 2s linear infinite;
}

@keyframes spin {
  to {
    transform: rotate(1turn);
  }
}

/* FORM SECTION */
.email {
  background: linear-gradient(
      180deg,
      rgba(0, 0, 0, 0.6) 0%,
      rgba(0, 0, 0, 0.6) 35%,
      rgba(0, 0, 0, 0.1) 100%
    ),
    url("./images/gym1.jpg") no-repeat center;
  background-size: cover;
  height: 450px;
  width: 100%;
  padding: 5rem calc((100vw - 1300px) / 2);
  color: var(--white);
  display: flex;
  justify-content: center;
  align-items: center;
}
.email__content {
  display: flex;
  flex-direction: column;
  align-items: center;
}

.email__content h1 {
  text-align: center;
  margin-bottom: 1rem;
  font-size: clamp(1rem, 5vw, 3rem);
  padding: 0 1rem;
}

.email__content p {
  text-align: center;
  font-size: clamp(1rem, 2.5vw, 1.5rem);
  padding: 0 1rem;
  margin-bottom: 2rem;
}

form {
  z-index: 10;
}

.form__wrap input {
  padding: 1rem 3rem;
  outline: none;
  width: 350px;
  height: 50px;
  margin-right: 1rem;
  border-radius: 4px;
}

@media screen and (max-width: 768px) {
  .form__wrap {
    display: flex;
    flex-direction: column;
    padding: 0 1rem;
  }

  .form__wrap input {
    margin-bottom: 1rem;
    width: 100%;
    margin-right: 0;
  }

  button {
    width: 100%;
    min-width: 350px;
  }
}

@media screen and (max-width: 400px) {
  button {
    width: 100%;
    min-width: 250px;
  }
}

/* FOOTER */
.footer {
  padding: 5rem calc((100vw - 1100px) / 2);
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  color: var(--white);
  background: var(--black);
  font-size: 1.3rem;
}

.footer__desc {
  padding: 2rem;
}
.footer__desc h1 {
  margin-bottom: 2rem;
  color: var(--red);
  font-size: 1.4rem;
  text-align: center;
}
.footer__desc p {
  margin-bottom: 1rem;
  padding: 1rem 2rem;
}

#phone {
  font-weight: bold;
  font-size: 1.2rem;
}

.footer__wraper {
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  padding: 20px;
}
.footer__links {
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  padding: 1rem 2rem;
}

.footer__title {
  font-size: 1rem;
  margin-bottom: 16px;
  color: var(--red);
}

hr {
  border: 3px solid darkred;
}
.footer__link {
  text-decoration: none;
  color: rgba(242, 242, 242);
  transition: 0.3s ease-in-out;
  font-size: 1.4rem;
}

.footer__link:hover {
  text-decoration: none;
  color: var(--red);
}

@media screen and (max-width: 820px) {
  .footer_wrapper {
    grid-template-columns: 1fr;
    display: flex;
    justify-content: space-around;
    font-size: 1.4rem;
  }
  .footer {
    padding: 5rem calc((100vw - 1100px) / 2);
    display: grid;
    grid-template-columns: repeat(2, 1fr);
    color: var(--white);
    background: var(--black);
    font-size: 1.3rem;
  }
}

@media screen and (max-width: 400px) {
  .footer_desc {
    padding: 1rem;
  }
  .footer_wrapper {
    grid-template-columns: 1fr;
    display: flex;
    justify-content: space-around;
    font-size: 1.4rem;
  }
}
